import axios from 'axios'
import { showRenewHistory } from '../actions/actions'

class GetRequest {
  static async getHistory() {
    return (dispatch) => {
      axios.get('his').then((response)=>{
        dispatch(showRenewHistory);
    });
    }
  }
}

export default GetRequest
